import com.eviware.soapui.support.XmlHolder
import groovy.sql.Sql



def DB_Res_xml= context.testCase.getTestStepByName("DB_Connection").getPropertyValue("ResponseAsXml")
//def DB_Count_xml= context.testCase.getTestStepByName("result_count").getPropertyValue("ResponseAsXml")


//log.info DB_Res_xml

def holder=new XmlHolder(DB_Res_xml)
//def cnt_holder=new XmlHolder(DB_Count_xml)
def email,firstname,lastname,city,dob

//def count=cnt_holder.getNodeValue("//*:COUNT")
//log.info count
def count =holder.getNodeValue("count(//*:Row)").toInteger()
log.info count

for (def i=1;i<=count;i++){

			email=holder.getNodeValue("//*:Row[$i]/CUSTOMER.EMAIL")
			firstname=holder.getNodeValue("//*:Row[$i]/CUSTOMER.FIRSTNAME")
			lastname=holder.getNodeValue("//*:Row[$i]/CUSTOMER.LASTNAME")
			city=holder.getNodeValue("//*:Row[$i]/CUSTOMER.CITY")
			dob=holder.getNodeValue("//*:Row[$i]/CUSTOMER.DOB")

			log.info "email >> $email :::  firstname >>> $firstname  :::   lastname >>>> $lastname ::: city >>> $city   :::   dob  >>>   $dob"

			def tc=testRunner.testCase.testSuite.project.testSuites['CustomerRepository TestSuite'].testCases['Property Expansion & Transfer']
//			testRunner.testCase.testSuite.project.testSuites['CustomerRepository TestSuite'].setPropertyValue("email_for_cust_IdUpdate",email)
			tc.testSteps['Customer_Property'].setPropertyValue("email",email)
			tc.testSteps['Customer_Property'].setPropertyValue("firstname",firstname)
			tc.testSteps['Customer_Property'].setPropertyValue("lastname",lastname)
			tc.testSteps['Customer_Property'].setPropertyValue("city",city)
			tc.testSteps['Customer_Property'].setPropertyValue("dob",dob)

			def runner=tc.run(null,false)

			//get the response customer id to store in DB further

			def custSave_Res = testRunner.testCase.testSuite.project.testSuites['CustomerRepository TestSuite'].testCases['Property Expansion & Transfer'].getTestStepByName("customerSave").getPropertyValue("response")
			def custSave_holder= new XmlHolder(custSave_Res)
			def custSave_Response_id=custSave_holder.getNodeValue("//*:result/id")

			def url='jdbc:mysql://localhost:3306/SDET'
			def driver='com.mysql.jdbc.Driver'
			def user='root'
			def password='root'

			//soapui to talk to database need jdbc driver
			com.eviware.soapui.support.GroovyUtils.registerJdbcDriver(driver)

			def sql= Sql.newInstance(url,user,password,driver)

			//SQL Query
			sql.execute("update customer set cust_id=$custSave_Response_id where email =$email") 

}
